column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli peut accepter les données de configuration JSON directes ainsi qu'un nom de fichier contenant la configuration. Dans ce dernier cas, le fichier est lu et le contenu est inséré dans cette propriété.

Exemples : set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

Usage: nmcli device reapply { ARGUMENTS | help }

ARGUMENTS := <ifname>

Tentatives de mettre à jour le périphérique avec les modifications apportées à la connexion active depuis sa dernière application.

column1:
Usage: nmcli device set { ARGUMENTS | help }

ARGUMENTS := DEVICE { PROPERTY [ PROPERTY ... ] }
DEVICE    := [ifname] <ifname> 
PROPERTY  := { autoconnect { yes | no } |
             { managed { yes | no }

Modify device properties.

column3:
Syntaxe : nmcli device set { ARGUMENTS | help }

ARGUMENTS := DEVICE { PROPERTY [ PROPERTY ... ] }
DEVICE    := [ifname] <ifname> 
PROPERTY  := { autoconnect { yes | no } |
             { managed { yes | no }

Modifie les propriétés du périphérique.

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
Syntaxe : nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
Syntaxe : nmcli general status { help }

Affiche le statut général de NetworkManager.
« status » est l'action par défaut, ce qui signifie que « nmcli gen » appelle « nmcli gen status »

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
Syntaxe : nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio { COMMAND | help }

COMMAND := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column3:
Syntaxe : nmcli radio { COMMAND | help }

COMMAND := { all | wifi | wwan }

  all | wifi | wwan | wimax [ on | off ]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Obtient le statut de tous les interrupteurs radios, les activer ou désactiver.

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
Syntaxe : nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Obtient le statut de l'interrupteur radio Wi-Fi, l'activer ou le désactiver.

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
Syntaxe : nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Obtient le statut de l'interrupteur radio du haut débit mobile, l'activer ou le désactiver.
